<!DOCTYPE html>
<html lang="ru">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>POLIS: Единая Система Презентаций</title>
    <style>
      /* --- ANIMATIONS --- */
      /* Slightly snappier animation that works well with scroll */
      @keyframes slideInUp {
        0% { opacity: 0; transform: translateY(20px) scale(0.98); }
        100% { opacity: 1; transform: translateY(0) scale(1); }
      }
      
      @keyframes gradientMove {
        0% { background-position: 0% 50%; }
        50% { background-position: 100% 50%; }
        100% { background-position: 0% 50%; }
      }

      @keyframes float {
        0% { transform: translateY(0px) rotate(0deg); }
        33% { transform: translateY(-20px) rotate(3deg); }
        66% { transform: translateY(10px) rotate(-2deg); }
        100% { transform: translateY(0px) rotate(0deg); }
      }

      @keyframes pulse-slow {
        0%, 100% { opacity: 0.3; }
        50% { opacity: 0.6; }
      }

      @keyframes spin-slow {
        from { transform: rotate(0deg); }
        to { transform: rotate(360deg); }
      }

      @keyframes scan {
        0% { top: 0%; opacity: 0; }
        10% { opacity: 1; }
        90% { opacity: 1; }
        100% { top: 100%; opacity: 0; }
      }

      @keyframes flicker {
        0% { opacity: 0.1; }
        5% { opacity: 0.2; } /* Reduced from 0.5 for subtlety */
        10% { opacity: 0.1; }
        100% { opacity: 0.1; }
      }

      .animate-slide-in {
        animation: slideInUp 0.8s cubic-bezier(0.2, 0.8, 0.2, 1) forwards;
        opacity: 0; /* Start invisible */
      }
      
      .animate-gradient {
        background-size: 300% 300%;
        animation: gradientMove 25s ease infinite;
      }

      .animate-float {
        animation: float 12s ease-in-out infinite;
      }
      
      .animate-pulse-slow {
        animation: pulse-slow 6s ease-in-out infinite;
      }

      .animate-spin-slow {
        animation: spin-slow 20s linear infinite;
      }

      .animate-scan {
        animation: scan 8s linear infinite;
      }

      .animate-flicker {
        animation: flicker 4s infinite;
      }

      /* --- UI ELEMENTS --- */
      .glass-panel {
        background: linear-gradient(145deg, rgba(255, 255, 255, 0.05) 0%, rgba(255, 255, 255, 0.01) 100%);
        backdrop-filter: blur(24px);
        -webkit-backdrop-filter: blur(24px);
        border: 1px solid rgba(255, 255, 255, 0.08);
        box-shadow: 0 8px 32px rgba(0, 0, 0, 0.2);
      }

      .glass-panel-highlight {
        background: linear-gradient(145deg, rgba(255, 255, 255, 0.08) 0%, rgba(255, 255, 255, 0.02) 100%);
        border: 1px solid rgba(255, 255, 255, 0.15);
        box-shadow: 0 8px 32px rgba(0, 0, 0, 0.25), inset 0 0 20px rgba(255,255,255,0.02);
      }
      
      body {
        font-family: 'Inter', sans-serif;
        background-color: #0f172a;
        -webkit-font-smoothing: antialiased;
        -moz-osx-font-smoothing: grayscale;
      }
      
      h1, h2, h3, .font-oswald {
        font-family: 'Oswald', sans-serif;
      }

      blockquote, .font-merriweather {
        font-family: 'Merriweather', serif;
      }

      /* Custom Scrollbar */
      * {
        scrollbar-width: thin;
        scrollbar-color: rgba(255, 255, 255, 0.2) rgba(255, 255, 255, 0.05);
      }

      ::-webkit-scrollbar {
        width: 8px;
        height: 8px;
      }
      ::-webkit-scrollbar-track {
        background: rgba(255, 255, 255, 0.02);
      }
      ::-webkit-scrollbar-thumb {
        background: rgba(255, 255, 255, 0.15);
        border-radius: 4px;
        border: 2px solid transparent;
        background-clip: content-box;
      }
      ::-webkit-scrollbar-thumb:hover {
        background-color: rgba(255, 255, 255, 0.3);
      }
    </style>

@keyframes matrixFall {
  0% { transform: translateY(-200%); opacity: 0; }
  8% { opacity: 0.25; }
  15% { opacity: 0.9; }
  75% { opacity: 0.7; }
  88% { opacity: 0.55; }
  100% { transform: translateY(100%); opacity: 0; }
}

@keyframes pulseLine {
  0% { background-position: 0% 50%; }
  100% { background-position: 150% 50%; }
}

@keyframes leafFall {
  0% {
    transform: translate3d(0, -10vh, 0) rotateZ(var(--tilt, 0deg));
    opacity: 0;
  }
  5% { opacity: 0.85; }
  95% { opacity: 0.85; }
  100% {
    transform: translate3d(0, 110vh, 0) rotateZ(var(--tilt, 0deg));
    opacity: 0;
  }
}

@keyframes leafSway {
  0% { transform: translateX(0) rotateZ(0deg); }
  25% { transform: translateX(calc(var(--drift, 0px) * 1)) rotateZ(5deg); }
  50% { transform: translateX(calc(var(--drift, 0px) * -0.8)) rotateZ(-3deg); }
  75% { transform: translateX(calc(var(--drift, 0px) * 0.6)) rotateZ(2deg); }
  100% { transform: translateX(0) rotateZ(0deg); }
}

@keyframes leafTumble {
  0% { transform: rotateZ(0deg); }
  25% { transform: rotateZ(90deg); }
  50% { transform: rotateZ(180deg); }
  75% { transform: rotateZ(270deg); }
  100% { transform: rotateZ(360deg); }
}

@keyframes leafWind {
  0% { transform: translateX(0) translateY(0); }
  33% { transform: translateX(20px) translateY(-5px); }
  66% { transform: translateX(-15px) translateY(3px); }
